    false,nt"url": null,nt"notes": "The Ottawa National Wildlife Refuge Complex
    Water Management Plan has been developed to meet the station objectives set forth
    in the Master Plan. Ottawa NWR, Cedar Point NWR, the Darby Division, and the Navarre
    Division are included. This annual water management plan provides guidelines for
    water levels after high lake level years, which damaged refuge dikes and other control
    structures. This plan also provides guidelines to control and combat the purple
    loosestrife infestation, as well as a growing population of Phragmites.",nt"license_title":
